import React from 'react'
import Laptop from '/laptop.png'

const Content2 = () => {
  return (
    <>
      <header className="header">
        <div className="container">
         
          <img className='' src={Laptop} alt='laptop'/>
        </div>
      </header>
    </>
  );
}

export default Content2
